#include <iostream>
#include <math.h>
#include <vector>
using namespace std;

bool isPalindrome(string input){
  int even = 0;
  if(input.length()==0){
    return false;
  }

  if(input.length()%2 == 0)
    even = 1;

  int half = input.length()/2;
  for(int i = 0; i <= half-even;i++){
    if(input[half-i-even] != input[half+i])
      return false;
  }
  return true;
}

int convertStringToInt(string input){
  int negative = 0;
  if(input[0]=='-'){
    negative = 1;
  }
  int len = input.length() - negative;
  int count = 0;
  // 12341
  for(int i = 0+negative; i < input.length(); i++){
    count *= 10;
    count += (input[i] - '0');
  }

  if(negative){
    count *= -1;
  }
  return count;
}

string allCharsOnceOrdered(string input, string input2){
  bool chars[256] = { 0 };
  for(int i = 0; i < input.length(); i++){
    chars[input[i]]=true;
  }
  for(int i = 0; i < input2.length(); i++){
    chars[input2[i]]=true;
  }
  string output = "";
  for(int i = 0; i < 256; i++){
    if(chars[i])
      output += (char) i;
  }
  return output;
}

string returnLongestPalindrome(string input){
  int len = input.length();
  if(isPalindrome(input))
    return input;
  for(int i = 1; i < len; i++){
    for(int j = 0; j <= i;j++){
      string mySubstring = input.substr(j,len-i);
      if(isPalindrome(mySubstring))
        return mySubstring;
      cout << mySubstring << endl;
    }
  }
  return "none";
}

void convertToIntArray(string input){
  int sum = 0;
  vector<int> number;
  for(int i = 0; i < input.length(); i++){
    sum *= 10;
    sum += input[i]-'0';
    if(input[i+1]==','|| i==input.length()-1){
      number.push_back(sum);
      sum = 0;
      ++i;
    }
  }

  for(int i = 0; i < number.size();i++){
    cout << number[i] << " ";
  }
  cout << endl;
  return;
}

int main() {
  cout << "Is palindrome: " << isPalindrome("racecar") << endl;
  cout << "Convert string to int: " << convertStringToInt("090320") << endl;
  cout << "All chars ordered once: " << allCharsOnceOrdered("aacxy", "ccxyyzx") << endl;
  cout << "Find longest palindrome within: " << returnLongestPalindrome("") << endl;
  convertToIntArray("12,4,612,23,61231,423,1");

  return 0;
}